import React from "react";
import Leftbar from "./Components/Leftbar";
import Box1 from "./Components/Box1";
import Box2 from "./Components/Box2";
import Box3 from "./Components/Box3";
import Box4 from "./Components/Box4";
function App() {
  return (
    <div>
      <Leftbar />
      <Box1 />
      <Box2 />
      <Box3 />
      <Box4 />
    </div>
  );
}

export default App;
